/*Table structure for table `activities` */

DROP TABLE IF EXISTS `activities`;

CREATE TABLE `activities` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `actType` int(11) NOT NULL COMMENT '活动类型团购30，限时抢购25',
