  `isVerify` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0未审核1已审核',
  `state` int(11) NOT NULL DEFAULT '0' COMMENT '0下架1上架',
  `isDel` int(11) NOT NULL DEFAULT '1' COMMENT '1正常127删除',
  `areaCode` varchar(15) NOT NULL COMMENT '活动范围，市为单位',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=62 DEFAULT CHARSET=utf8;

