/*Table structure for table `advert` */

DROP TABLE IF EXISTS `advert`;

CREATE TABLE `advert` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT,
  `code` bigint(11) NOT NULL COMMENT '供应商id',
  `name` varchar(255) DEFAULT NULL COMMENT '广告图片地址',
  `url` varchar(255) DEFAULT NULL COMMENT '广告链接地址',
  `remark` varchar(254) DEFAULT NULL COMMENT '备注',
  `isUse` tinyint(1) DEFAULT '1' COMMENT '是否启用',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='广告表';

/*Data for the table `advert` */

/*Table structure for table `amountLog` */

DROP TABLE IF EXISTS `amountLog`;

CREATE TABLE `amountLog` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT,
  `userId` bigint(11) NOT NULL COMMENT '用户Id',
  `money` decimal(10,2) NOT NULL COMMENT '金额',
  `curAmount` decimal(10,2) NOT NULL COMMENT '操作后用户总金额',
  `operator` bigint(11) DEFAULT NULL COMMENT '操作人',
  `type` int(4) NOT NULL COMMENT '类型1存入2支出',
  `createTime` datetime NOT NULL COMMENT '操作时间',
  `remark` varchar(254) DEFAULT NULL COMMENT '备注',
  `origin` int(11) NOT NULL DEFAULT '1' COMMENT '1前台，2后台',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1389 DEFAULT CHARSET=utf8 COMMENT='资金变更日志';

