/*Table structure for table `amountOrder` */

DROP TABLE IF EXISTS `amountOrder`;

CREATE TABLE `amountOrder` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT,
  `voucherOrderNum` varchar(50) NOT NULL COMMENT '订单号',
  `userId` bigint(11) NOT NULL COMMENT '用户id',
  `money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '金额',
  `status` int(2) NOT NULL DEFAULT '0' COMMENT '状态 0 未成功  1成功',
  `createTime` datetime NOT NULL COMMENT '充值时间',
  `remark` varchar(254) DEFAULT NULL COMMENT '备注',
  `thirdOrderNum` varchar(254) DEFAULT NULL COMMENT '第三方订单号',
  PRIMARY KEY (`id`)
