/*Table structure for table `cmsUser` */

DROP TABLE IF EXISTS `cmsUser`;

CREATE TABLE `cmsUser` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT,
  `userName` varchar(20) DEFAULT NULL COMMENT '用户名',
  `password` varchar(50) DEFAULT NULL COMMENT '密码',
  `name` varchar(10) DEFAULT NULL COMMENT '真实姓名',
  `email` varchar(50) DEFAULT NULL COMMENT '邮箱',
  `mobile` varchar(20) DEFAULT NULL COMMENT '电话',
  `sex` int(2) DEFAULT '1' COMMENT '1 男  2 女  9 其他 ',
  `department` varchar(50) DEFAULT NULL COMMENT '部门',
  `roleId` int(8) NOT NULL COMMENT '角色id 多对一关系',
  `state` int(2) DEFAULT '1' COMMENT '用户状态 1正常 127删除',
  PRIMARY KEY (`id`),
  UNIQUE KEY `userName` (`userName`)
) ENGINE=InnoDB AUTO_INCREMENT=98 DEFAULT CHARSET=utf8 COMMENT='cms用户表';

