/*Table structure for table `coupon` */

DROP TABLE IF EXISTS `coupon`;

CREATE TABLE `coupon` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'id',
  `name` varchar(50) NOT NULL COMMENT '名称',
  `parValue` int(10) unsigned NOT NULL COMMENT '面值',
  `minimum` int(10) unsigned NOT NULL COMMENT '门槛值',
  `total` int(10) NOT NULL COMMENT '发行数量',
  `num` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '发行数量 领取优惠券减一',
  `limitType` int(10) unsigned NOT NULL COMMENT '限制类型1.注册优惠劵',
  `validityStart` date NOT NULL COMMENT '有效期开始',
  `validityEnd` date NOT NULL COMMENT '有效期结束日',
  `limitCat` bigint(20) unsigned DEFAULT NULL COMMENT '限制品类 null全品类 品类id',
  `remark` text COMMENT '备注信息',
  `genDate` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '生成时间',
  `isDel` int(11) NOT NULL DEFAULT '1' COMMENT '1正常 127删除',
  `startdate` datetime NOT NULL COMMENT '优惠劵领取开始时间',
  `enddate` datetime NOT NULL COMMENT '优惠价领取结束时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=103 DEFAULT CHARSET=utf8 COMMENT='优惠券';

