/*Table structure for table `deliveryAddress` */

DROP TABLE IF EXISTS `deliveryAddress`;

CREATE TABLE `deliveryAddress` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT,
  `orderId` bigint(11) NOT NULL COMMENT '定单id',
  `province` int(8) NOT NULL COMMENT '省',
  `city` int(8) NOT NULL COMMENT '市',
  `district` int(8) NOT NULL COMMENT '区',
  `community` int(8) DEFAULT NULL COMMENT '商圈',
  `provinceName` varchar(50) DEFAULT NULL COMMENT '省名',
  `cityName` varchar(50) DEFAULT NULL COMMENT '市名',
  `districtName` varchar(50) DEFAULT NULL COMMENT '区名',
  `communityName` varchar(50) DEFAULT NULL COMMENT '商圈名',
  `mobile` varchar(20) NOT NULL COMMENT '手机号',
  `phone` varchar(20) DEFAULT NULL COMMENT '收货人的联系电话',
  `receiver` varchar(20) DEFAULT NULL COMMENT '收货人',
  `postcode` varchar(20) DEFAULT NULL COMMENT '邮编',
  `pavilionId` int(8) DEFAULT NULL COMMENT '亭子id',
  `pavilionCode` varchar(15) NOT NULL COMMENT '亭子code或者区域code',
  `pavilionName` varchar(50) DEFAULT NULL COMMENT '亭子名称',
  `remark` varchar(254) DEFAULT NULL COMMENT '备注地址',
  `startdate` datetime DEFAULT NULL COMMENT '用户期望配送开始时间',
  `enddate` datetime DEFAULT NULL COMMENT '用户期望配送结束时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1191 DEFAULT CHARSET=utf8 COMMENT='订单收货地址表';

