/*Table structure for table `goodsArea` */

DROP TABLE IF EXISTS `goodsArea`;

CREATE TABLE `goodsArea` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT,
  `goodsId` bigint(11) DEFAULT NULL COMMENT '商品ID',
  `provinceId` int(8) DEFAULT NULL COMMENT '省',
  `cityId` int(8) DEFAULT NULL COMMENT '城市',
  `districtId` int(8) DEFAULT NULL COMMENT '地区',
  `communityId` int(8) DEFAULT NULL COMMENT '商圈',
  `pavilionId` int(8) DEFAULT NULL COMMENT '亭子ID',
  `limitCode` varchar(15) NOT NULL COMMENT '限购code',
  `isLimit` tinyint(1) DEFAULT '0' COMMENT '是否限购 0否 1是',
  `number` int(8) unsigned NOT NULL DEFAULT '0' COMMENT '数量',
  `isDel` int(4) NOT NULL DEFAULT '1' COMMENT '1正常127删除',
  `createTime` datetime DEFAULT NULL COMMENT ' 创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=111 DEFAULT CHARSET=utf8 COMMENT='商品销售区域表';

