/*Table structure for table `goodsComment` */

DROP TABLE IF EXISTS `goodsComment`;

CREATE TABLE `goodsComment` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `orderId` bigint(20) NOT NULL COMMENT '订单id',
  `userId` bigint(20) NOT NULL COMMENT '用户id',
  `goodsId` bigint(20) NOT NULL COMMENT '商品id',
  `content` varchar(254) NOT NULL COMMENT '评论',
  `reply` varchar(254) DEFAULT NULL COMMENT '回复',
  `grade` int(10) unsigned NOT NULL DEFAULT '5' COMMENT '分数5为最高分',
  `isAnonymous` int(11) NOT NULL DEFAULT '0' COMMENT '是否匿名0否1是',
  `pics` varchar(254) DEFAULT NULL COMMENT '晒图，用|将多张图分割',
  `isVerify` int(11) NOT NULL DEFAULT '0' COMMENT '0未审核1审核',
  `createTime` datetime NOT NULL COMMENT '评论时间',
  `isDel` int(11) NOT NULL DEFAULT '1' COMMENT '1正常127删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

/*Data for the table `goodsComment` */

