/*Table structure for table `goodsDetail` */

DROP TABLE IF EXISTS `goodsDetail`;

CREATE TABLE `goodsDetail` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT,
  `goodsId` bigint(11) DEFAULT NULL COMMENT '商品ID',
  `description` varchar(2000) DEFAULT NULL COMMENT '描述',
  `photoUrl1` varchar(255) DEFAULT NULL COMMENT '图片路径',
  `photoUrl2` varchar(255) DEFAULT NULL COMMENT '图片路径',
  `photoUrl3` varchar(255) DEFAULT NULL COMMENT '图片路径',
  `photoUrl4` varchar(255) DEFAULT NULL COMMENT '图片路径 ',
  `photoUrl` varchar(255) DEFAULT NULL COMMENT '图片相对路径',
  PRIMARY KEY (`id`),
  UNIQUE KEY `goodsDetail_goodsId` (`goodsId`)
) ENGINE=InnoDB AUTO_INCREMENT=436 DEFAULT CHARSET=utf8 COMMENT='商品图片表';

