/*Table structure for table `goodsStock` */

DROP TABLE IF EXISTS `goodsStock`;

CREATE TABLE `goodsStock` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT,
  `goodsId` bigint(11) DEFAULT NULL COMMENT '商品ID',
  `providerId` bigint(11) DEFAULT NULL COMMENT '供货商ID',
  `virtualNumber` int(8) unsigned NOT NULL DEFAULT '0' COMMENT '虚拟库存',
  `createTime` datetime DEFAULT NULL COMMENT ' 创建时间',
  `modifyTime` datetime DEFAULT NULL COMMENT ' 修改时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `goodsStock_goodsId` (`goodsId`)
) ENGINE=InnoDB AUTO_INCREMENT=436 DEFAULT CHARSET=utf8 COMMENT='商品库存表';

