/*Table structure for table `orderDetail` */

DROP TABLE IF EXISTS `orderDetail`;

CREATE TABLE `orderDetail` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT,
  `orderId` bigint(11) NOT NULL COMMENT '定单id',
  `providerId` bigint(11) NOT NULL COMMENT '供货商Id',
  `goodsId` bigint(11) NOT NULL COMMENT '商品id',
  `price` decimal(10,2) DEFAULT NULL COMMENT '商品购买价格',
  `marketPrice` decimal(10,2) DEFAULT NULL COMMENT '市场价',
  `number` int(8) NOT NULL DEFAULT '0' COMMENT '商品数量',
  `isDelivery` int(8) NOT NULL DEFAULT '0' COMMENT '是否已提货  0：否 (默认) 1 是',
  `createTime` datetime DEFAULT NULL COMMENT '创建时间',
  `effPay` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '实际付款金额',
  `isRefund` int(11) NOT NULL DEFAULT '0' COMMENT '0不参与退货，1参与退货',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1788 DEFAULT CHARSET=utf8 COMMENT='订单详情表';

