/*Table structure for table `orderPay` */

DROP TABLE IF EXISTS `orderPay`;

CREATE TABLE `orderPay` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT,
  `orderId` bigint(11) NOT NULL COMMENT '定单id',
  `userId` bigint(11) NOT NULL COMMENT '会员id',
  `payCode` int(4) NOT NULL COMMENT '支付类型（支付宝1,余额2,代购余额3）',
  `payName` varchar(10) NOT NULL COMMENT '支付名称',
  `createTime` datetime DEFAULT NULL COMMENT '创建时间',
  `account` varchar(255) DEFAULT NULL COMMENT '付款账户',
  PRIMARY KEY (`id`)
