/*Table structure for table `orderRefund` */

DROP TABLE IF EXISTS `orderRefund`;

CREATE TABLE `orderRefund` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `orderId` bigint(20) NOT NULL COMMENT '退换货订单id',
  `newOrderId` bigint(20) DEFAULT NULL COMMENT '换货订单id',
  `orderDetailId` bigint(20) NOT NULL COMMENT '订单明细id',
  `state` int(11) NOT NULL DEFAULT '1' COMMENT '1处理中2退货完成127取消申请',
  `origin` int(11) NOT NULL DEFAULT '1' COMMENT '退换货发起人 1用户2亭子',
  `createTime` datetime NOT NULL COMMENT '创建时间',
  `type` int(11) NOT NULL DEFAULT '1' COMMENT '退换货类型 1退货2换货',
  `refundPrice` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '退款金额',
  `moneyWay` int(11) DEFAULT NULL COMMENT '退款方式 1余额 2付款账户',
  `account` varchar(255) DEFAULT NULL COMMENT '退款账户',
  `remark` varchar(255) NOT NULL COMMENT '客户留言',
  `photoUrl1` varchar(255) DEFAULT NULL COMMENT '图片1',
  `photoUrl2` varchar(255) DEFAULT NULL COMMENT '图片2',
  `photoUrl3` varchar(255) DEFAULT NULL COMMENT '图片3',
  `pickupWay` int(11) NOT NULL DEFAULT '1' COMMENT '取货方式1 送至服务亭 2上门去提',
  `deliveryType` int(11) NOT NULL COMMENT '送货方式1 自提 2 送货上门',
  `provinceIdT` int(11) NOT NULL COMMENT '取货地址 省',
  `cityIdT` int(11) NOT NULL COMMENT '市',
  `districtIdT` int(11) NOT NULL COMMENT '区',
  `communityIdT` int(11) NOT NULL COMMENT '商圈',
  `pavilionIdT` int(11) NOT NULL COMMENT '亭子',
  `remarkT` varchar(254) NOT NULL COMMENT '详细地址',
  `receiverT` varchar(50) NOT NULL COMMENT '送货人',
  `mobileT` varchar(20) NOT NULL COMMENT '送货人电话',
  `provinceIdF` int(11) NOT NULL COMMENT '收货地址 省',
  `cityIdF` int(11) NOT NULL COMMENT '市',
  `districtIdF` int(11) NOT NULL COMMENT '区',
  `communityIdF` int(11) NOT NULL COMMENT '商圈',
  `pavilionIdF` int(11) NOT NULL COMMENT '亭子',
  `remarkF` varchar(254) NOT NULL COMMENT '详细地址',
  `receiverF` varchar(50) NOT NULL COMMENT '收货人',
  `mobileF` varchar(20) NOT NULL COMMENT '收货人电话',
  PRIMARY KEY (`id`),
  UNIQUE KEY `orderRefund_orderDetailId` (`orderDetailId`)
) ENGINE=InnoDB AUTO_INCREMENT=87 DEFAULT CHARSET=utf8;

/*Data for the table `orderRefund` */

