/*Table structure for table `orders` */

DROP TABLE IF EXISTS `orders`;

CREATE TABLE `orders` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT,
  `orderNum` varchar(50) DEFAULT NULL COMMENT ' 订单号',
  `status` int(2) NOT NULL DEFAULT '1' COMMENT '状态  1 未确认 2 确认  3  处理中  4 已发货 5 确认收货  6 退货中  7 退货完成  ',
  `state` int(4) NOT NULL DEFAULT '1' COMMENT '1 正常  2  取消  127  删除',
  `orderPrice` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '订单金额，描述订单金额不可修改',
  `payPrice` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '应该支付金额',
  `amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商品总额',
  `paidPrice` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '已付金额',
  `userId` bigint(11) NOT NULL COMMENT '会员id',
  `createTime` datetime NOT NULL COMMENT '下单时间',
  `modifyTime` datetime DEFAULT NULL COMMENT '修改时间',
  `payTime` datetime DEFAULT NULL COMMENT '支付时间',
  `deliveryTime` datetime DEFAULT NULL COMMENT '发货时间',
  `receiveTime` datetime DEFAULT NULL COMMENT '收货时间',
  `remark` varchar(254) DEFAULT NULL COMMENT '备注',
  `cart` varchar(254) DEFAULT NULL COMMENT '购物车',
  `discutPrice` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '优惠金额   默认为 0',
  `useBalancePrice` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '使用余额   默认为 0',
  `deliveryType` int(4) DEFAULT NULL COMMENT '提货方式  1 自提   2  送货',
  `isPaid` int(2) NOT NULL DEFAULT '1' COMMENT '是否支付 1未付款，2已付款',
  `deliverCode` varchar(20) DEFAULT NULL COMMENT '提货码',
  `channelId` int(11) NOT NULL DEFAULT '1' COMMENT '订单渠道 1pc 2手机 3后台下单',
  `createUserId` bigint(11) NOT NULL COMMENT '下单用户id',
  `shopType` int(11) NOT NULL DEFAULT '1' COMMENT '1自购2代购',
  `isCardBuy` int(11) NOT NULL DEFAULT '0' COMMENT '0未刷卡1刷卡购买',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1230 DEFAULT CHARSET=utf8 COMMENT='订单表';

