/*Table structure for table `ordersLog` */

DROP TABLE IF EXISTS `ordersLog`;

CREATE TABLE `ordersLog` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT,
  `orderId` bigint(11) NOT NULL COMMENT '订单Id',
  `operType` int(4) NOT NULL COMMENT '1.后台操作，2亭子人员操作，3系统自动操作',
  `operId` bigint(11) DEFAULT NULL COMMENT '操作人员Id',
  `operName` varchar(50) DEFAULT NULL COMMENT '操作人员姓名',
  `createTime` datetime NOT NULL COMMENT '操作时间',
  `remark` varchar(254) DEFAULT NULL COMMENT '操作备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1362 DEFAULT CHARSET=utf8;

