/*Table structure for table `user` */

DROP TABLE IF EXISTS `user`;

CREATE TABLE `user` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT,
  `userName` varchar(20) NOT NULL COMMENT '账户名 唯一',
  `password` varchar(50) NOT NULL COMMENT '密码',
  `mobile` varchar(20) DEFAULT NULL COMMENT '手机号',
  `bindCardNum` varchar(20) DEFAULT NULL COMMENT '绑定的卡号',
  `sex` int(2) DEFAULT NULL COMMENT '1男2女9其他',
  `photo` varchar(255) DEFAULT NULL COMMENT '用户头像',
  `rank` int(4) NOT NULL DEFAULT '1' COMMENT '等级',
  `email` varchar(50) DEFAULT NULL COMMENT '邮箱',
  `alias` varchar(100) DEFAULT NULL COMMENT '昵称',
  `createTime` datetime DEFAULT NULL COMMENT '创建时间',
  `lastLoginTime` datetime DEFAULT NULL COMMENT '最后登录时间',
  `modifyTime` datetime DEFAULT NULL COMMENT '修改时间',
  `province` int(8) DEFAULT NULL COMMENT '省',
  `city` int(8) DEFAULT NULL COMMENT '城市',
  `district` int(8) DEFAULT NULL COMMENT '地区',
  `community` int(8) DEFAULT NULL COMMENT '商圈',
  `pavilionId` int(8) DEFAULT NULL COMMENT '亭子id',
  `pavilionCode` varchar(15) DEFAULT NULL COMMENT '亭子code',
  `lastLoginip` varchar(20) DEFAULT NULL COMMENT '最后登录ip',
  `amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '用户总金额 初始为0',
  `points` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '消费积分',
  `totalConsume` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '总消费',
  `unionToken` varchar(100) DEFAULT NULL COMMENT '联合登陆',
  `memberType` int(2) DEFAULT NULL COMMENT '1 普通用户   2  服务厅  ',
  `unionType` int(4) DEFAULT NULL COMMENT '联合登陆 类型',
  `channelId` int(8) DEFAULT NULL COMMENT '渠道Id（用户来源）',
  `payPassword` varchar(50) DEFAULT NULL COMMENT '支付密码',
  `accountType` int(4) NOT NULL DEFAULT '1' COMMENT '账户状态1.正常，2冻结',
  PRIMARY KEY (`id`),
  UNIQUE KEY `UK_user_username` (`userName`),
  UNIQUE KEY `UK_user_mobile` (`mobile`)
