/*Table structure for table `userAddress` */

DROP TABLE IF EXISTS `userAddress`;

CREATE TABLE `userAddress` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT,
  `userId` bigint(11) NOT NULL COMMENT '用户id',
  `pavilionId` int(8) DEFAULT NULL COMMENT '亭子id',
  `pavilionCode` varchar(15) DEFAULT NULL COMMENT '亭子code',
  `province` int(8) NOT NULL COMMENT '省',
  `city` int(8) NOT NULL COMMENT '城市',
  `district` int(8) NOT NULL COMMENT '地区',
  `community` int(8) DEFAULT NULL COMMENT '商圈',
  `addressDetail` varchar(254) DEFAULT NULL COMMENT '详细地址',
  `isdel` int(4) DEFAULT NULL COMMENT '默认 1 正常   127 删除',
  `createTime` datetime DEFAULT NULL COMMENT '创建时间',
  `postcode` varchar(20) DEFAULT NULL COMMENT '邮政编号',
  `mobile` varchar(20) DEFAULT NULL COMMENT '手机号',
  `receiver` varchar(20) DEFAULT NULL COMMENT '接收人',
  `phone` varchar(20) DEFAULT NULL COMMENT '接收人电话',
  `isdefault` tinyint(1) DEFAULT '0' COMMENT '0 否 默认 1 是',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=434 DEFAULT CHARSET=utf8 COMMENT='地址信息表';

