/*Table structure for table `userCoupon` */

DROP TABLE IF EXISTS `userCoupon`;

CREATE TABLE `userCoupon` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'id',
  `code` varchar(50) DEFAULT NULL COMMENT '优惠券码',
  `couponId` bigint(20) unsigned NOT NULL COMMENT '优惠券id',
  `usrId` bigint(20) unsigned NOT NULL COMMENT '用户id',
  `genDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '生成时间',
  `consumptionDate` timestamp NULL DEFAULT NULL COMMENT '消费时间',
  `orderId` bigint(20) unsigned DEFAULT NULL COMMENT '订单id',
  `orderNum` varchar(50) DEFAULT NULL COMMENT '订单号',
  PRIMARY KEY (`id`),
  UNIQUE KEY `userPromote_uk_code` (`code`)
) ENGINE=InnoDB AUTO_INCREMENT=884 DEFAULT CHARSET=utf8 COMMENT='R_用户-优惠券';

