/*!50106 CREATE EVENT `goods_statistics_event` ON SCHEDULE EVERY 1 MINUTE STARTS '2015-03-25 10:30:34' ON COMPLETION NOT PRESERVE ENABLE DO call goods_statistics() */$$
DELIMITER ;

/* Procedure structure for procedure `goods_statistics` */

/*!50003 DROP PROCEDURE IF EXISTS  `goods_statistics` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `goods_statistics`()
BEGIN
    
   DECLARE goodsId INT;
   DECLARE goodsNumM INT;
   DECLARE goodsNumW INT;
   DECLARE isExist INT;
  -- 遍历数据结束标志
   DECLARE done INT DEFAULT FALSE;
   
  -- 游标
   DECLARE cur CURSOR FOR SELECT id FROM goods WHERE isSale = 1;
  
  -- 将结束标志绑定到游标
  
  
   DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
  -- 打开游标
   OPEN cur;
  
  -- 开始循环
  read_loop: LOOP
    -- 提取游标里的数据，这里只有一个，多个的话也一样；
    FETCH cur INTO goodsId;
    -- 声明结束的时候
    IF done THEN
      LEAVE read_loop;
    END IF;
    -- 这里做你想做的循环的事件
    -- 获得7天数据
    SELECT IFNULL(SUM(number),FLOOR(RAND()*100)) INTO goodsNumW FROM orderDetail od LEFT JOIN orders o ON od.orderId = o.id WHERE od.goodsId = goodsId AND o.state = 1 AND DATE_SUB(CURDATE(), INTERVAL 7 DAY) <= DATE(od.createTime);
  
    -- 获得销售数据
    SELECT IFNULL(SUM(number),FLOOR(RAND()*100)) INTO goodsNumM FROM orderDetail od WHERE od.goodsId = goodsId;
    
    SELECT COUNT(1) INTO isExist FROM goodsStatistics gs WHERE gs.goodsId = goodsId;
    
    IF isExist = 0 THEN
    INSERT INTO goodsStatistics (goodsId) VALUES (goodsId);
    END IF; 
    
    UPDATE goodsStatistics gs SET gs.monthNum = goodsNumM + 200, gs.weekNum = goodsNumW + 50 WHERE gs.goodsId = goodsId;
    
  END LOOP;
  -- 关闭游标
  CLOSE cur;
  
END */$$
DELIMITER ;

